        {
            var a = new MassMomentOfInertia(valueA, unitA);
            var b = new MassMomentOfInertia(valueB, unitB);

            // Operator overloads.
            Assert.Equal(expectEqual, a == b);
            Assert.Equal(expectEqual, b == a);
            Assert.Equal(!expectEqual, a != b);
